  false,\n\t\"url\": null,\n\t\"notes\": \"This coverage contains polygons representing
  the PLSS township boundaries of the state of Iowa. TOWNSHIP was developed from a
  set of 99 individual county coverages of PLSS section lines. The county section
  coverages were appended together and section lines within a township were removed.
  The PLSS coverages were digitized from paper copies of 7.5' topo quad maps. River
  boundaries were also digitized from 7.5' maps.\",\n\t\"license_title\": null,\n\t\"extras\":
